  render(){

    return (
    <div className="App">
      <h1>Pong 1972</h1>
      <Switch>
      <Route exact path='/' component={HomePage} />
        <Route path='/play' component={Game} />
        {/* <Route path='/sign-in' component={SignInAndSignUpPage} /> */}
        </Switch>
  </div>
  );
  }
}



export default App;
